import React, { Component } from 'react';
// import { Link } from 'react-router-dom';
import './home.scss';

class Home extends Component {
  render() {
    return (
      <div className='body home'>
        <div className='add-item'>
          <h2>Add new item</h2>
          <form class="form" action="/" method="POST">
            <label for="name">What should we buy...?</label>
            <input type="text" name="name" placeholder="add item to list..."></input>

            <input class="button" type="submit" value="Add item"></input>
          </form>
        </div>

        <div className='shopping-list'>
          <h2>Shopping list</h2>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
            <li>Item 3</li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Home;
